import React from 'react';
import HeaderWrapper from '../components/HeaderWrapper';

const styles = {
  profileImage: {
    transform: 'translateY(-50px)'
  }
};

export default function Account() {
  return (
    <div>
      <HeaderWrapper>
        <h1> 12 Jan 2020 </h1>
      </HeaderWrapper>
      <img style={styles.profileImage} src={require('../images/profile.jpg')} alt="profile" />

      <div> Alert here </div>

      <h1> Alec Down </h1>

      <p> Profile </p>
    </div>
  );
}
